Description
Katie Gold, Maya Hills, Jayna Oso, Bree Olson, Renee Pornero, Vanessa Lane, Hillary Scott, Leah Luv

You don't need to be a friend of Hillary to be considered a Ho, but it certainly helps. Hillary starts us off with a reminder of why we consider her a dirty ho, then introduces us to six of her slutty girlfriends who take you on a wild ride that will leave you panting.

